import React from 'react';
import JournalEntry from "./JournalEntry";

const JournalEntries = () => {
    const entries = [1,2,3,4,5];

    return (
        <div className="journal-entries mt-2">
            {
                entries.map(value => (
                    <JournalEntry key={value} />
                ))
            }
        </div>
    );
};

export default JournalEntries;
